    short_name: "Рундштедт",
    default_name: "Герд фон Рундштедт",
    full_name: "Карл Рудольф Герд фон Рундштедт",
    descr: "<p>Рундштедт, Герд фон (Rundstedt), (1875-1953гг.), генерал-фельдмаршал германской армии. В 1932г. в звании генерал-оберста (генерал-полковник) он был назначен командующим 1-й армейской группой в Берлине. В феврале 1938г. вместе с четырнадцатью другими высокопоставленными офицерами фон Рундштедт был уволен из вооруженных сил в результате дела Бломберга-Фрича. В августе 1939г. его снова вернули в армию в качестве начальника штаба группы армий «Юг». В мае-июне 1940г. фон Рундштедт являлся начальником штаба группы армий на Западном фронте. На этом посту на нем лежала основная ответственность за проведение Французской кампании. В знак признания его заслуг 19 июля 1940г. Гитлер присвоил фон Рундштедту звание генерал-фельдмаршала.</p><p>Во время нападения на Советский Союз фон Рундштедт командовал группой армий «Юг». В его задачи входило выход к Черному морю, захват Ростова и Майкопских нефтяных месторождений, а затем бросок на Сталинград. Ввиду разногласий с Гитлером по поводу стратегии боевых действий в России фон Рундштедт был снят с должности 12 декабря 1941г. 1 марта 1942г. он был назначен начальником штаба западной группы войск вместо генерала Эрвина фон Вицлебена. Этот пост он занимал с короткими перерывами до марта 1945г. 2 июля 1944г. Гитлер, взбешенный тем, что фон Рундштедт не сумел предотвратить вторжение англо-американских войск в Нормандию, временно отстранил его от должности, назначив на его место фельдмаршала Гюнтера Ханса фон Клюге.</p><p>В начале 1942г. фон Рундштедту стало известно о заговоре высокопоставленных офицеров с целью отстранения Гитлера от власти. Хотя фон Рундштедт никогда не был убежденным нацистом, он отказался принять участие в заговоре, заявив генералу Эрвину Роммелю: «Вы молоды и популярны среди народа. Вам надо осуществлять это». После провала Июльского заговора 1944г. верный присяге на верность фюреру фон Рундштедт председательствовал на офицерском суде чести, разбиравшем степень вины заговорщиков, и изгонял их из армии еще прежде, чем они представали перед Народным трибуналом. Лебединой песней фон Рундштедта была наступательная операция в Арденнах в декабре 1944г., которой так и не удалось остановить продвижение союзнических войск.</p>",
