    default_name: "Эрих фон Манштейн",
    full_name: "Фриц Эрих Георг Эдуард фон Манштейн",
    descr: "<p>Манштейн (Manstein) Эрих фон Левински (Lewinski) (24.11.1887г., Берлин, — 10.06.1973г., Мюнхен), один из нацистских военных преступников, генерал-фельдмаршал, представитель прусской военной  аристократии, активный участник разработки и осуществления фашистских агрессивных планов во 2-й мировой войне. Военную службу начал в 1906г. Окончил Военную академию (1914г.). Участник 1-й мировой войны, после которой служил в рейхсвере. В 1935—38гг. начальник операт.ивногоуправления и 1-й оберквартирмейстер генштаба сухопутных войск. Участвовал в оккупации Судетской обл., в агрессии против Польши. В 1939г. — февраль - начальник штаба группы армий «Юг», затем группы армий «А». Манштейн — один из авторов плана разгрома Франции ударом через Арденны. В военных действиях против Франции (1940г.) командовал 38-м корпусом. Во время нападения фашистской Германии на СССР, Манштейн был командиром 56-го танкового корпуса (группа армий «Север»), участвовал в наступлении на Ленинград. С сентября 1941г. командовал 11-й армией, действовавшей в Крыму. В августе 1942г. осуществлял общее руководство боевыми действиями немецко-фашистских войск под Ленинградом. Командуя группой армий «Дон» (нояб.1942г. — февр.1943г.), Манштейн безуспешно пытался деблокировать 6-ю армию, окружённую под Сталинградом. С февраля 1943г. командовал группой армий «Юг», терпевшей поражения в ходе Курской битвы и в др. сражениях. При отступлении широко практиковал тактику «выжженной земли». За неудачи на фронте Манштейн в марте 1944г. был отстранён от командования и зачислен в резерв. После 2-й мировой войны, в 1950г., Манштейн за совершённые им военные преступления был приговорён британским военным трибуналом к 18 годам тюрьмы. В 1953г. освобождён. Манштейн был почётным членом ряда реваншистских организаций. В выпущенных мемуарах пытался оправдать свои преступления необходимостью выполнения солдатского долга, а военные неудачи на Восточном фронте — бездарностью Гитлера.</p>",
