    descr: "<p>Карл Альмендингер (нем. Karl Allmendinger; 3 февраля 1891г. — 2 октября 1965г.) — немецкий офицер, участник Первой и Второй мировых войн, генерал пехоты, кавалер Рыцарского креста с Дубовыми листьями.<br />С октября 1939г. — начальник штаба 5-го армейского корпуса.<br />В мае-июне 1940г. участвовал во Французской кампании. Награждён планками к Железным крестам обеих степеней (повторное награждение).<br />С августа 1940г. — генерал-майор. С 25 октября 1940г. — командир 5-й пехотной дивизии.<br />С 22 июня 1941г. — участвовал в Великой Отечественной войне. Бои в Белоруссии. В июле 1941г. награждён Рыцарским крестом (№ 365). Затем бои на Московском направлении.<br />С августа 1942г. — генерал-лейтенант. В декабре 1942г. — награждён Дубовыми листьями к Рыцарскому кресту.<br />В январе-июне 1943г. — преподаватель на курсах подготовки командиров дивизий (в Берлине). С апреля 1943г. — в звании генерал пехоты. С июля 1943г. — командующий 5-м армейским корпусом (на Кавказе).<br />С мая 1944г. — вместо снятого А. Гитлером 1 мая Эрвина Йенеке командующий 17-й армией, которая неудачно обороняла Крым и откатилась к Севастополю.10 мая эвакуировался морем вместе со штабом на шнельботе. С 25 июля 1944г. — в командном резерве.<br />16 мая 1945г. — взят в плен американцами (отпущен на свободу в декабре 1947г.).</p>",
