    full_name: "Пауль Людвиг Эвальд фон Клейст",
    descr: "<p>Клейст (Kleist) Эвальд Пауль Людвиг фон (08.08.1881г., Браунфельс-на-Лане, Гессен - 15.10.1954г., Владимир, СССР) военачальник, генерал-фельдмаршал. Окончил военное училище. В марте 1900г. вступил фаненюнкером в 3-й пеший артиллерийский полк, в 1901г. произведен в лейтенанты. В 1909г. окончил кавалерийское училище в Ганновере, в 1912г. - Военную академию. Участник 1-й мировой войны на Восточном и Западном фронтах, командир эскадрона, офицер Генерального штаба. В 1919г. после демобилизации армии остался служить в рейхсвере. Убежденный монархист, не симпатизировал нацистам. С 1920г. служил в кавалерии, с 1923г. в Ганноверском кавалерийском училище. С 1927г. начальник штаба 2-й кавалерийской дивизии (Бреслау), с 1928г. - 3-й пехотной дивизии. С 1931г. командир 9-го пехотного полка (Потсдам). 01.02.1932г. сменил генералаГ. фон Рундштедта на посту командира 2-й кавалерийской дивизии. 01.05.1935г. дивизия Клейста была расформирована, а на базе ее штаба создано командование 8-го армейского корпуса и 8-го военного округа в Бреслау. Клейст был назначен их командиром. Во время «чистки» высшего военного командования, после дела «Бломберга-Фрича», Клейст 04.02.1938г. уволен в отставку. В августе 1939г. вернулся в строй и назначен командиром 22-го армейского корпуса, представлявшего собой танковую группу. В составе 14-й армии генерала В. Листа участвовал в Польской компании; захватил нефтедобывающий район под Львовом. Участвовал в боях на Сомме, в Бордо и, совершив бросок к Ла-Маншу, завершил образование Дюнкерского котла. Перед началом войны с СССР группа Клейста (3-й и 48-й танковые, 4-й моторизованный корпуса) вошла в состав группы армий «Юг» генерал-фельдмаршала Г фон Рунштедта. 5 июля начал наступление на «линию Сталина» на старой советской границе, прорвав которую взял 10 июля Житомир. С 21.11.1942г. командующий группой армий «А», в которую кроме 1-й танковой входила также 17-я армия генерала Р. Руоффа. В январе 1943г. советские войска прорвали оборону войск Клейста, но А. Гитлер лишь в самый последний момент разрешил Клейсту отступать, и тому удалось удержать Кубань. На территори, подконтрольной группе армий «А», Клейст проводил целенаправленную политику по привлечению на сторону вермахта представителей различных народов СССР. В его войсках по некоторым данным состояло более 800 тысяч человек (карачаевцы, кабардины, осетины, ингуши, азербайджанцы, калмыки, казаки и другие). Старался гуманно обращаться с местным населением, из-за чего вскоре у Клейста возник конфликт с рейхскомиссаром Украины Э. Кохом и генеральным уполномоченным по использованию рабочей силы Ф. Заукелем. Запретил частям СС проводить операции на подконтрольной ему территории.</p><p>03.09.1943г. добился от Гитлера разрешения эвакуировать Кубань, чем спас более 300 тыс. человек. После оставления Крыма и отступления на Южный Буг Клейст 31 марта был вызван в ставку, награжден Рыцарским крестом с дубовыми ветвями и мечами и уволен в отставку, а в апреле группа армий «А» была переименована в группу армий «Южная Украина», а ее командующим назначен Ф. Шёрнер. После покушения на Гитлера 20.07.1944г. был арестован гестапо. Клейст обвинялся в том, что знал о существовании заговора и не сообщил об этом. Однако затем он был освобожден. 25.04.1945г. арестован американскими войсками и вывезен в Лондон, в качестве свидетеля привлечен к работе Международного военного трибунала в Нюрнберге. В сентябре 1946г. передан Югославии и в августе 1948г. приговорен югославским народным судом к 15 годам каторжных работ. В марте 1949г. передан СССР. Содержался во внутренней тюрьме МГБ, Бутырской и Лефортовской тюрьмах, а затем во Владимирской тюрьме. 21.02.1952г. Военной коллегией Верховного суда СССР приговорен к 25 годам заключения в лагерях. По официальной версии умер в лагере от недостаточности митрального клапана.</p>",
