    full_name: "Фердинанд Шёрнер",
    descr: "<p>Шёрнер, Фердинанд (Schoerner), (1892-1973гг.), генерал-фельдмаршал германской армии. Участник 1-й мировой войны, был награжден медалью «За доблесть». Принимал участие в подавлении «Пивного путча» 1923г., хотя и симпатизировал нацистскому движению и состоял членом нескольких националистических организаций. Впоследствии стал ярым поклонником Гитлера и одним из самых преданных ему высокопоставленных офицеров. В 1942-43гг. Шёрнер командовал 19-м горно-стрелковым корпусом в Лапландии, затем, до 1 февраля 1944г., 40-м танковым корпусом, воевавшим на Украине. 7 апреля 1944г. он был назначен главнокомандующим группой армий «Юг», 25 июля 1944г. - главнокомандующим группой армий «Север». 16 января 1945г. Шёрнер стал главнокомандующим центральной группировкой войск. В последние дни 2-й мировой войны Гитлер присвоил Шёрнеру звание генерал - фельдмаршала и назначил его командовать уже почти разгромленной группировкой войск, прикрывавшей Берлин. После того, как последние его войска капитулировали, Шёрнер вылетел в американскую зону оккупации в Австрии, откуда он был выдан советскому командованию. Он был приговорен к 10 годам заключения, освобожден в апреле 1955г., оказался первым среди германских фельдмаршалов, кому было разрешено вернуться в Зап. Германию. В 1957г. мюнхенский суд вновь приговорил Шёрнера к 4 с половиной годам тюрьмы как виновного в гибели тысяч немецких солдат.</p>",
