    default_name: "Федор фон Бок",
    full_name: "Федор фон Бок",
    descr: "<p>Бок (Bock) Федор фон (03.12.1880г., Кюстрин, Бранденбург - 04.05.1945г.) Военачальник, генерал-фельдмаршал. Образование получил в кадетском корпусе. В 1898г. вступил в 5-й Потсдамский гвардейски полк. С 1904г. адъютант батальона, с 1906г. - полка. В 1910г. окончил Военную академию. С 1912г. служил в Генеральном штабе, частник 1-й мировой войны: в 1914-15гг. начальник оперативного -отдела штаба 6-й армии. С 1915г. командир батальона 4-го Пруского гвардейского полка. За боевые отличия награжден Железным крестом 1-го и 2-го классов и орденом «Pour le Merite». После восстания в сентябре 1923 г. частей «черного рейхсвера» Бок был привлечен к судебному процессу в качестве свидетеля, при этом левая пресса голословно обвиняла Бока в причастности к политическим убийствам. В 1924г. командир 2-го батальона 4-го пехотного полка (Кольберг), в 1925-26гг. служил в Военном министерстве. С конца 1928г. командир 1-й кавалерийской дивизии (Франкфурт-на-Одере), с 1930г. - 1-й пехотной дивизией и военным округом в Кенигсберге. 01.04.1935г. после создания 3-го командования группы сухопутных сил в Дрездене Бок был назначен его командующим. 31.10.1938г. возглавил наиболее важное - 1-е командование в Берлине. В 1938г. во время аншлюса Австрии командовал войсками 8-й армии, занявшими территорию страны. В конце 1938г. войска под командованием Бока оккупировали Судетскую область. С августа 1939г. командующий группой армий «Север». Во время Польской кампании войска Бока (около 60 тыс. человек) захватили так называемый «Польский коридор» и вышли к Брест-Литовску, где соединились с советскими войсками. 30.09.1939г. награжден Рыцарским крестом Железного креста. Во Французской компании занял Нидерланды, Бельгию, и, разбив франко-английские войска, командовал войсками, осуществлявшими прикрытие советско-германской демаркационной линии. Отрицательно отнесся к плавам А. Гитлера начать войну против СССР. С 21.06.1941г. командующий группой армий «Центр», которая развивала наступление в направлении на Москву. 29 июня окружил крупную группировку советской армии под Минском, взяв в плен 03.07.1941г. около 324 тыс. человек и уничтожив 3332 танка и 1809 орудий. В Смоленском котле Бок 05.08.1941г. взял в плен 310 тыс. человек, в Гомельском котле (24. августа) -около 84 тыс. Человек. При этом потери Бока составляли менее 1/5 от советских. 30.09-19.10.1941г. провел операцию в районе Вязьмы и Брянска, взяв в плен около 665 тыс. человек. Сторонник продолжения наступления, несмотря на плохие погодные условия и неподготовленность армии вести бои в зимних условиях. Участвуя в боях за Дон, и не смотря на приказ Гитлера, втянулся в сражения за Воронеж и 15.07.1942г. под предлогом болезни был снят с командования. В начале мая 1945г. выехал к К. Дёницу, решив предложить ему свои услуги. По дороге в Киль его автомобиль был расстрелян английским самолетом. Бок вместе с женой и дочерью погиб.</p>",
