    descr: "<p>Гот (Hoth) Герман (12.04.1880г., Нойруппин - 25.01.1971г., Гослар) военачальник, генерал-полковник. 27.02.1904г. вступил в сухопутные войска. Участник Первой мировой войны, после демобилизации армии оставлен в рейхсвере. С 1935г. командир 18-й дивизии в Лигнау. С 01.10.1938г. командир 15-го армейского корпуса в Йене. Во время Польской компании корпус Гота (5-я и 7-я танковые дивизии) действовал в составе 10-й армии генерала В. фон Рейхенау, Прорвал оборону армии «Краков» и принял активное участие в окружении армии «Прусы» в районе Радома; участник штурма Варшавы. При начале Французской компании корпус Гота был развернут за порядками 4-й армии генерала Г. фон Клюге. Успешные действия Г Гота способствовали капитуляции частей 10-й французской армии в районе Дьепа. 18.06.1940г. взял Ренн и захватил штаб 10-й армии, 20 июня взял Нант, а 25 июня - Руан. При подготовке войны с СССР назначен 16.11.1940г. командующим 3-й танковой группы, в состав которой вошли 39-й и 57-й танковые корпуса (всего 4 танковых и 3 моторизованных дивизии). 22.06.1941г. перешел границу СССР и 24 июня взял Вильнюс, 28 июня - Минск, 10 ноля - Витебск, 14 октября - Калинин. 7.10.1941г. 7-я дивизия группы Гота вышла к Вязьме, где соединилась с 10-й дивизией 4-й танковой группы, завершив окружение 5 советских армий. С 17.10.1941г. командующий 17-й армией, входившей в состав группы армий «Юг». 01.06.1942г. переведен на пост командующего 4-й танковой группой на Воронежском фронте. Вместе с 6-й армией генерала Ф. Паулюса развивал наступление на Сталинград. В июне 1942г. нанес сокрушительное поражение 5-й советской танковой армии. Когда группировка Паулюса была окружена, в котле оказался и один из корпусов Гота - 48-й танковый корпус генерал-лейтенанта Ф. Хейма. Армия Гот вместе со 2-й и 6-й армиями вошла в состав группы армий «Дон» генерала Э. фон Манштейна и принимала участие в боях под Ростовом и др.12-23.12.1942г. предпринял отчаянную попытку деблокировать армию Паулюса, но в связи с тем, что 6-й армии А. Гитлер запретил прорываться из котла, операция была сорвана. В феврале 1943г. Манштейн сосредоточил под командованием Гота все танковые соединения группы армий. Его армия была использована Манштейном для контрнаступления - 22 февраля Гот (48-й, 57-й танковые корпуса и 2-й танковый корпус СС) атаковал советские войска и 14 марта, восстановив фронт по правому берегу Донца, взял Харьков. Участвовал в боях на Курской дуге. 4 июля начал наступление на южной её части. Первоначально ему сопутствовал успех, но 7 июля он был вынужден отвести дивизии первого эшелона - потери были огромны. Подчиняясь приказу Гитлера, силами дивизий СС «Адольф Гитлер» и «Рейх» атаковал и прорвал 3-ю - последнюю - линию обороны, потеряв при этом около 300 танков.15.09.1943г. награжден Рыцарским крестом с дубовыми ветвями и мечами.10.12.1943г. заменен генералом Э. Рауссом. Больше года находился в резерве ставки, а в агрусте 1945г. назначен командующим оборонительным районом в Рудных горах, сдался в плен американским войскам. На 12-м процессе Американского военного трибунала в Нюрнберге по делу ОКХ 27.10.1948г. приговорен к 15 годам тюремного заключена. В 1954г. освобожден.</p>",
