    default_name: "Фридрих Паулюс",
    full_name: "Фридрих Вильгельм Эрнст Паулюс",
    descr: "<p>Родился 23 сентября 1890г. в Брейтенау, Гессен. Умер 1 февраля 1957г. в Дрез­дене. Генерал-фельдмаршал, командующий 6-й полевой армией вермахта (5 января 1942г. – 31 января 1943).</p><p>3 сентября 1940г. в звании генерал-лейтенанта в дол­жности 1-го оберквартирмейстера гене­рального штаба сухопутных войск Герма­нии занимается разработкой плана «Бар­баросса» – нападения на Советский Союз.</p><p>5 января 1942г. принимает командова­ние 6-й полевой армией, которая в составе груп­пы войск «Б» в 1942г. ведет наступление на Сталинград. Имея задачу в течение од­ной недели овладеть городом, армия ве­дет безуспешные бои в районе Сталинграда 200 дней и ночей. Оказавшись в кольце окружения советских войск, не решается на са­мостоятельные действия по прорыву, ос­таваясь верным приказу фюрера – сто­ять до конца.</p><p>Отказавшись принять пред­ложение советского командования о капитуля­ции, обрекает свою армию на полное унич­тожение. Звание фельдмаршала получил в ночь на 31 января 1943г. накануне плене­ния. Находясь в советском плену, в 1944 всту­пает в антифашистский Союз немецких офицеров, а затем в Национальный ко­митет «Свободная Германия».</p><p>На Нюрн­бергском процессе выступал в качестве свидетеля со стороны советского обвинения.</p><p>Пос­ле освобождения в 1953г. проживал в Дрез­дене (Восточная Германия), где формаль­но имел чин офицера народной полиции. Имеет награды.</p>",
