    short_name: "Харпе",
    default_name: "Йозеф Харпе",
    full_name: "Йозеф Харпе",
    descr: "<p>Йозеф Харпе (21 сентября 1887 - 14 марта 1968) был немецким генералом во время Второй мировой войны, командовал 9-й армией.</p><p>Командуя 1-й танковой бригадой, участвовал в Польской кампании. Награждён планками к Железным крестам обеих степеней (повторное награждение). С 30 августа 1940г. — генерал-майор.</p><p>В октябре 1940г. принял командование 2-й моторизованной дивизией, которая под его руководством была в январе 1941г. переформирована в 12-ю танковую дивизию.</p><p>Во время операции «Барбаросса» 12-я танковая дивизия наступала на Минск, Смоленск в составе группы армий «Центр», с сентября 1941г. — на Ленинград в составе группы армий «Север». В августе 1941г. — Харпе награждён Рыцарским крестом. В декабре 1941г. — награждён Дубовыми Листьями (№ 55) к Рыцарскому кресту.</p><p>В январе 1942г. произведён в генерал-лейтенанты, назначен командующим 41-м танковым корпусом. 1 июня 1942г. произведён в генералы танковых войск.</p><p>В феврале 1943г. награждён Золотым немецким крестом, в сентябре 1943г. — Мечами (№ 36) к Рыцарскому кресту с Дубовыми Листьями.</p><p>С ноября 1943г. — командующий 9-й армией. В мае 1944г. — произведен в генерал-полковники и назначен командующим 4-й танковой армии. В сентябре 1944г. — возглавил группу армий «Северная Украина» (переименована в группу армий «А»).</p><p>17 января 1945г. снят с должности и отправлен в резерв командования сухопутных сил после прорыва советских войск в ходе Висло-Одерской операции. С 9 марта 1945г. — командующий 5-й танковой армией на Западном фронте, 17 апреля 1945г. — взят в американский плен. До 14 апреля 1948г. находился в лагере для военнопленных.</p><p>Умер в Нюрнберге 14 марта 1968г. в возрасте 80 лет.</p>",
