    short_name: "Геббельс",
    default_name: "Йозеф Геббельс",
    full_name: "Йозеф Геббельс",
    descr: "<p>Йозеф Геббельс – один из самых яркий представителей верхушки, фашисткой Германии, ближайший соратник Гитлера. Йозеф был замечательным пропагандистом, сильным оратором, умеющим убедить людей в правоте своих мыслей и идей. На роль вождя Геббельс никогда не претендовал, он отводил себе место около Гитлера, оставаясь в политической иерархии чуть ниже него.</p><p>Йозеф родилс в 1897 году в самой обычной немецкой семье. Отец работал бухгалтером, но был очень набожным человеком, и мечтал о том, что сын станет священником. Сын не разделял чаяния отца, ему нравилась философия и литература, и он мечтал, скорее о карьере журналиста, ну или писателя.</p><p>В 1921 году он защитил докторскую диссертацию, однако успеха в качестве литератора не добился. Либеральные издательства то и дело забраковывали труды Геббельса. Свое призвание в итоге Йозеф нашел в политике. Он примкнул к НСДАП. Сначала он был в «левом» крыле партии. Однако его заметил Гитлер, и переманил талантливого оратора на свою сторону. В 1926 году Гитлер отправляет Йозефа в Берлин, в качестве главного пропагандиста. Через четыре года он будет заведовать всей пропагандой НСДАП, и руководить газетой «Дер ангрифф». Когда Гитлеру удалось взять власть в Германии в свои руки, Геббельс стал занимать важные государственные посты. Йозеф отвечал за народное образование, пропаганду и культуру.</p><p>Он отвечал за мобилизацию немцев на поддержку программных установок НСДАП. 29 апреля 1945 года Гитлер, который покончил жизнь самоубийством, написал, что Геббельс является его приемником на должности рейхсканцлера. В новой должности Йозеф провел около суток. Отправив парламентера к генералу Чуйкову с предложением о перемирии, за время которого немцы обещали сформировать новое правительство и решить вопрос о войне. Советское руководство такой вариант развития событий не устроил. В итоге Геббель вместе с женой Магдой решились на самоубийство, также погубив своих 6 детей.</p>",
