    short_name: "Муссолини",
    default_name: "Бенито Муссолини",
    full_name: "Бенито Муссолини",
    descr: "<p>Муссолини родился 29 июля 1883 года в провинции Романья. Его отец, Алессандро Муссолини, был кузнецом и революционером, за что нередко попадал под арест. Будущий диктатор не отставал от отца во взглядах. В молодости Муссолини успел поработать учителем в гимназии и написать несколько статей для газет. Позже он работал журналистом, также был прирожденным оратором и ездил по Италии с выступлениями на политическую тему.</p><p>В 1915 году был призван в итальянскую армию. Его полк расположился на Изонцовском участке Итальянского фронта. Его сослуживцы утверждали, что Бенито самым первым бросался в атаку. В ноября 1915 Муссолини попал в госпиталь из-за заболевания тифом. В феврале 1917 он снова оказался в госпитале. На этот раз по причине тяжёлого ранения.</p><p>В 1919 году Муссолини создает Итальянский союз борьбы, который в 1921 году превращается в Национальную фашистскую (от итальянского fascio «союз») партию. Вскоре он становится премьер-министром Италии. Муссолини взял всю власть себе, ограничев влияние короля Виктора Эмануила III. В 1928 году фашистская партия становится в Италии единственной, остальные политические объединения признаются нелегальными. Государство контролировало практически все сферы жизни общества, а любые отклонения жестко наказывались.</p><p>Италия вступила в войну на стороне Оси по двум причинам: Во-первых, страна была союзницей Германии. Во-вторых, Муссолини желал восстановить Римскую империю.</p><p>Однако итальянская армия потерпела серъёзное поражение в Северной Африке. В ноябре 1943 союзники высаживаються в Сицилии и Сардиии. Позже они берут Рим. Муссолини пытается сбежать, но итальянские партизаны ловят его вместе с любовницей. Обоих расстреливают 28 апреля 1945 года. Их тела подвешивают за ноги и публично показывают народу.</p>",
