    descr: "<p>Роммель (Rommel) Эрвин (15.11. 1891, г. Хейденхейм, Баден-Вюртемберг,— 14.10. 1944, Херлинген, близ г. Ульм), ген.-фельдмаршал нем.-фаш. армии (1942). На воен. службе с 1910, участник 1-й мировой войны. Во время ноябрьской бурж.-демократич. революции 1918 в Германии командовал охранной ротой, принимавшей участие в подавлении выступлений трудящихся Рурской обл. С 1919 служил в рейхсвере: ком-р роты, преподаватель тактики пех. школы в Дрездене, ком-р егерского батальона в г. Гослар. С 1935 на службе в фаш. вермахте. Был преподавателем воен. школы в Потсдаме, нач-ком воен. школы в Винер-Нёйштадте, затем воен. комендантом ставки Гитлера. С февр. 1940 ком-р 7-й танк, дивизии, участвовавшей в походе против Франции. С февр. 1941 по март 1943 командовал нем. экспедиц. силами в Сев. Африке, а в июле — нояб. 1943 группой армий «Б» в Сев. Италии; по его приказам осуществлялись карательные операции против итал. борцов Сопротивления. В дек. 1943 выполнял функции воен. инспектора ставки верх, командования в Дании. С дек. 1943 по июль 1944 командующий группой армий «Б» во Франции. Был связан с руководителями антигитлеровского заговора 20 июля 1944. После раскрытия заговора покончил жизнь самоубийством.</p>",
