        holidays: "<p><span>5 — 16 января 1944г.</span> - Кировоградская операция. После напряженных боев 8 января войска 2-го Украинского фронта овладели Кировоградом и продолжали наступление. Однако, 16 января, отражая сильные контрудары врага, были вынуждены перейти к обороне. В результате Кировоградской операции положение немецко-фашистских войск в полосе действий 2-го Украинского фронта значительно ухудшилось.</p><p><span>12 – 18 января 1943г.</span> – Начало наступательной операции войск Ленинградского и Волховского фронтов во взаимодействии с Балтийским флотом. Прорыв блокады Ленинграда.</p><p><span>17 января 1945г.</span> - Освобождена Варшава. Фашисты буквально стерли город с лица земли, а местных жителей подвергли беспощадному уничтожению.</p><p><span>27 января 1944г.</span> – День полного освобождения Ленинграда от фашистской блокады.</p><p><span>27 января 1945г.</span> – Советские войска освободили узников фашистского концлагеря в Освенциме.</p><p><span>27 января 1944г.</span> - День полного освобождения советскими войсками города Ленинграда от блокады его немецко-фашистскими войсками.</p><p><span>30 января – 9 апреля 1945г.</span> – Разгром немецкой группировки в Кенигсберге (ныне Калининград). Это был кульминационный момент Восточно-Прусской операции.</p>"
